import React from 'react';

import './SearchResults.css';

import Card from './Card';

const SearchResults = ({ 
  results,
  addCardToDeck,
  removeCardFromDeck}) => {
  return (
    <div id="results">
    <h3>Here's what we found ({ results.length } results):</h3>
    { 
        results.map(result => (
          <Card key={ result.id } { ...result } />
        ))
      }
  </div>
  );
}


export default SearchResults;
